postman.clearEnvironmentVariable("curDate");

function padding(pad){

    if(pad < 10){

        return '0' + pad;
    }else{

        return pad;
    }
}

function setCurDate(){

    var date = new Date();
    var year = date.getFullYear();
    var mon = (date.getMonth() + 1);
    var day = date.getDate();

    var currentDate = year + '-' + padding(mon) + '-' + padding(day);

    return currentDate;
}

pm.environment.set("curDate", setCurDate());

postman.clearEnvironmentVariable("curDayMon");

function padding(num){

    if(num < 10){
        return '0' + num;
    }else{
        return num;
    }
}

function curDayMon(){

    var arrMon= ["JAN", "FEB", "MAR", "APR", "MAY", "JUN", "JUL", "AUG", "SEP", "OCT", "NOV", "DEC"];
    var date = new Date();
    var day = date.getDate();
    var mon = (date.getMonth());
    var month = arrMon[mon];

    var composedDay = padding(day) + month; 

    return composedDay;
}

pm.environment.set("curDayMon", curDayMon());

