function padding(pad){

    if(pad < 10){

        return '0' + pad;
    }else{

        return pad;
    }
}

function setCurDate(){

    var date = new Date();
    var year = date.getFullYear();
    var mon = (date.getMonth() + 1);
    var day = date.getDate() + 1;

    var currentDate = year + '-' + padding(mon) + '-' + padding(day);

    return currentDate;
}

pm.environment.set("tomDate", setCurDate());

postman.clearEnvironmentVariable("tomDayMon");

function padding(num){

    if(num < 10){
        return '0' + num;
    }else{
        return num;
    }
}

function curDayMon(){

    var arrMon= ["JAN", "FEB", "MAR", "APR", "MAY", "JUN", "JUL", "AUG", "SEP", "OCT", "NOV", "DEC"];
    var date = new Date();
    var day = date.getDate() + 1;
    var mon = (date.getMonth());
    var month = arrMon[mon];

    var composedDay = padding(day) + month; 

    return composedDay;
}

pm.environment.set("tomDayMon", curDayMon());

